def get_lucky_number(N: int) -> str:
    for i in range(N // 6, -1, -1):
        n1 = N - i * 6
        for j in range(n1 // 10, -1, -1):
            n2 = n1 - j * 10
            for k in range(n2 // 15, -1, -1):
                if i * 6 + j * 10 + k * 15 == N:
                    return '5' * (i * 6) + '3' * (j * 10) + '2' * (k * 15)
    return ''

